	_Assetsf8019d847a310b8817abc3a4f51253ff2e2a7a93 = "<!DOCTYPE html>\n<html>\n\n<head>\n    <meta charset=\"utf-8\">\n    <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1\">\n    <title>Login - Istyle CAS</title>\n    <link rel=\"stylesheet\" href=\"/assets/css/font-awesome.min.css\">\n    <!-- Bulma Version 0.7.1-->\n    <link rel=\"stylesheet\" href=\"/assets/css/bulma.min.css\" />\n    <style type=\"text/css\">\n        @font-face {\n            font-family: 'Open Sans';\n            src: url('/assets/ttf/OpenSans-Regular.ttf') format('truetype');\n        }\n\n        html,\n        body {\n            font-family: 'Open Sans', serif;\n            font-size: 14px;\n            font-weight: 300;\n        }\n\n        .hero.is-success {\n            background: #F2F6FA;\n        }\n\n        .hero .nav,\n        .hero.is-success .nav {\n            -webkit-box-shadow: none;\n            box-shadow: none;\n        }\n\n        .box {\n            margin-top: 5rem;\n        }\n\n        .avatar {\n            margin-top: -70px;\n            padding-bottom: 20px;\n        }\n\n        .avatar img {\n            padding: 5px;\n            background: #fff;\n            border-radius: 50%;\n            -webkit-box-shadow: 0 2px 3px rgba(10, 10, 10, .1), 0 0 0 1px rgba(10, 10, 10, .1);\n            box-shadow: 0 2px 3px rgba(10, 10, 10, .1), 0 0 0 1px rgba(10, 10, 10, .1);\n        }\n\n        input {\n            font-weight: 300;\n        }\n\n        p {\n            font-weight: 700;\n        }\n\n        p.subtitle {\n            padding-top: 1rem;\n        }\n    </style>\n</head>\n\n<body>\n    <section class=\"hero is-success is-fullheight\">\n        <div class=\"hero-body\">\n            {{ range $m := .Messages }}\n            <article class=\"message is-primary\">\n                <div class=\"message-header\">\n                    <p>Message</p>\n                    <button class=\"delete\" aria-label=\"delete\"></button>\n                </div>\n                <div class=\"message-body\">\n                    {{ $m }}\n                </div>\n            </article>\n            {{ end }} {{ range $m := .Errors }}\n            <article class=\"message is-danger\">\n                <div class=\"message-header\">\n                    <p>Error</p>\n                    <button class=\"delete\" aria-label=\"delete\"></button>\n                </div>\n                <div class=\"message-body\">\n                    {{ $m }}\n                </div>\n            </article>\n            {{ end }}\n            <div class=\"container has-text-centered\">\n                <div class=\"column is-4 is-offset-4\">\n                    <h3 class=\"title has-text-grey\">Login</h3>\n                    <p class=\"subtitle has-text-grey\">Please login to proceed.</p>\n                    <div class=\"box\">\n                        <form method=\"post\" action=\"/login\">\n                            <div class=\"field\">\n                                <div class=\"control\">\n                                    <input class=\"input is-large\" name=\"username\" type=\"text\" placeholder=\"Your User Name\" autofocus=\"\" tabindex=\"1\" accesskey=\"u\"\n                                        value=\"{{ .UserName }}\">\n                                </div>\n                            </div>\n\n                            <div class=\"field\">\n                                <div class=\"control\">\n                                    <input class=\"input is-large\" type=\"password\" name=\"password\" placeholder=\"Your Password\" tabindex=\"2\" accesskey=\"p\" autocomplete=\"off\"\n                                        value=\"{{ .Password }}\">\n                                </div>\n                            </div>\n                            <div class=\"field\">\n                                <label class=\"checkbox\">\n                                    <input type=\"checkbox\"> Remember me\n                                </label>\n                            </div>\n                            <input type=\"hidden\" name=\"lt\" value=\"{{ .LoginTicket }}\">\n                            <input type=\"hidden\" name=\"service\" value=\"{{ .Service }}\">\n                            <button class=\"button is-block is-info is-large is-fullwidth\">Login</button>\n                        </form>\n                    </div>\n                </div>\n            </div>\n        </div>\n    </section>\n</body>\n\n</html>"

